CREATE TABLE `LopHocPhan` (
  `MaLopHP` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `MaKyHoc` varchar(6) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `MaHP` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `BuoiSo` int NOT NULL,
  `SoLuongMax` int DEFAULT NULL,
  `SoLuongSinhVien` int DEFAULT 0,
  `MaPhong` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Thu` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `KipHoc` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ThoiGianBatDau` time DEFAULT NULL,
  `ThoiGianKetThuc` time DEFAULT NULL,
  `TuanHoc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `LoaiLop` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `DotMo` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `MaQL` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`MaLopHP`),
  KEY `idx_lophocphan_makyhoc` (`MaKyHoc`),
  KEY `idx_lophocphan_mahp` (`MaHP`),
  KEY `idx_lophocphan_maphong` (`MaPhong`),
  CONSTRAINT `fk_lophocphan_kyhoc` FOREIGN KEY (`MaKyHoc`) REFERENCES `KyHoc` (`MaKyHoc`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_lophocphan_hp` FOREIGN KEY (`MaHP`) REFERENCES `hp` (`MaHP`) ON DELETE CASCADE ON UPDATE CASCADE,
