DELETE lhp
FROM `LopHocPhan` AS lhp
INNER JOIN (
    SELECT
        `MaLopHP`, 
        `MaKyHoc`, 
        `MaHP`, 
        `BuoiSo`,
        ROW_NUMBER() OVER (
            PARTITION BY `MaLopHP` 
            ORDER BY `MaKyHoc` ASC, `MaHP` ASC, `BuoiSo` ASC
        ) as rn
    FROM
        `LopHocPhan`
) AS RankedDuplicates
ON lhp.`MaLopHP` = RankedDuplicates.`MaLopHP`
   AND lhp.`MaKyHoc` = RankedDuplicates.`MaKyHoc`
   AND lhp.`MaHP` = RankedDuplicates.`MaHP`
   AND lhp.`BuoiSo` = RankedDuplicates.`BuoiSo` -- Join trên toàn bộ khóa chính
WHERE RankedDuplicates.rn > 1;
